import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar';
import Map from './Components/Map';
import GetweatherByLocation from './Components/GetLocation';
import { GetweatherByCity } from './Components/GetLocation';

function App() {

  return (
    <div className="App">
     <Navbar />
     <Map />
     <GetweatherByCity />
     <div className='tagLine'>
       <h1 id="madeBysudeep">Made with ❤️ by Gudekota Sudeep </h1>
     </div>
    </div>
  );
}

export default App;
